<pre class="lang-js prettyprint-override"><code>const userSchema = new mongoose.Schema({

    // --- Works
    isActive: {
        type: Boolean,
        select: false,
    },

    // --- Does NOT work
    clientsList: [ {
        type: mongoose.Schema.Types.ObjectId,
        ref: 'Client',
        select: false,
    }],
});
</code></pre>

<p>If I retrieve this user with <code>User.findById</code>, then the returned User object will not include <code>isActive</code> (as expected), but will include <code>clientsList</code> (not expected).</p>

<p><strong>Is there a way to deselect the second field as well?</strong> </p>

<p>PS: I understand that I can manually do <code>.select('-clientsList')</code> at the query level, but would prefer to deselect it add the model level, similar to the first field.</p>

