Data leak due to using asynchronous function<p>I am getting a data leak while using an asychronous function causing my application to not load the second page during navigation. </p>

<p>I am using async/await on my get request, and I have tried to use a cleanup function to prevent this leak, but it is not working. </p>

<p>How do I fix this leak, and still get the data to load when the page is loaded?</p>

<pre><code>import React, { useEffect, useState, useContext } from "react";
import ReactTable from "react-table";
import "react-table/react-table.css";
import axios from "axios";
import StatusContext from "../../context/status/statusContext";

const Table = props =&gt; {
  const [tableData, setTableData] = useState([]);

  const statusContext = useContext(StatusContext);

  useEffect(async () =&gt; {
    await axios
      .get("/api/status")
      .then(function(response) {
        console.log(response.data);
        setTableData(
          response.data.filter(item =&gt; {
            let itemDate = new Date(item.date);
            let variableDate = new Date() - 604800000;

            return itemDate &gt; variableDate;
          })
        );
      })
      .catch(function(error) {
        console.log(error);
      });
  }, [statusContext]);

  const columns = [
    {
      id: "Name",
      Header: "Name",
      accessor: "name"
    },
    {
      Header: "Date",
      accessor: "date"
    },
    {
      Header: "Comment",
      accessor: "comment"
    }
  ];

  return (
    &lt;ReactTable
      data={tableData}
      columns={columns}
      pivotBy={["date"]}
      defaultPageSize={7}
      minRows={5}
    /&gt;
  );
};

export default Table;

</code></pre>

