nodejs+mongodb native driver+ExpressJS Rest API- connect once and reuse design suggestion<p>I am learning to use the mongodb native driver along with nodeJS and ExpressJS. I am new to NodeJS so please bear with me.</p>

<p>The UI CLIENT sends data to the REST API endpoint and the POST call inserts the data (document) into MongoDB collection.</p>

<p>When I am going through the examples at MongoDB native driver <a href="https://mongodb.github.io/node-mongodb-native/3.4/quick-start/quick-start/" rel="nofollow noreferrer">documentation</a>, I notice that <code>collection.insertOne</code>, <code>collection.save</code> are always performed as a callback to the <code>mongo_client.connect</code>. I don't understand this because I want to connect to mongo_client once and continue to update the collection and bring down the connection (mongo_client.close) when the express server is brought down. I understand that callbacks are safe.</p>

<pre><code>const client = new MongoClient(url, {useNewUrlParser: true});

// Use connect method to connect to the server
client.connect(function(err) {
  assert.equal(null, err);
  console.log("Connected successfully to server");

  const db = client.db(dbName);

  insertDocuments(db, function() {
    client.close();
  });
});
</code></pre>

<p>Why do I have to connect for every CRUD operation? save the state of the connection to the db/collection and cannot reuse?</p>

<p><strong>My existing code:</strong></p>

<pre><code>const express = require('express')
const app = express()
const server_port = 64726
const MongoClient = require('mongodb').MongoClient;

const insert_user = (id, email)=&gt; {

mongo_client.connect(err =&gt; {
console.log("mongo connect function called....")
assert.equal(null, err)
console.log ("connected successfully to DB ")
const mongo_user_collection = mongo_client.db(mongo_db_name).collection("users");
mongo_user_collection.save ({'_id':id,'email':email,'lastlogin': new Date() })
// perform actions on the collection object
// mongo_client.close();
});
}


app.post ('/api/login/verify', (req, res) =&gt; {
    insert_user(req.body.id,req.body.email);
})

app.listen(server_port, ()=&gt;{
console.log('Server started...')
})
</code></pre>

<p>In my code, I see for every post call I need to connect and then insert the document. How to avoid this behavior so I can Connect once, reuse connection and insert docs for every POST call?</p>

